INSERT INTO `his_config_info` VALUES (0, 360, 'sys-config-db.properties', 'DEFAULT_GROUP', '', 'db.service.ipAddress=119.23.27.78\n####################################################################################################\n############################################### hikari 数据源配置 ################\n####################################################################################################\n# jdbc_config  datasource\nspring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver\nspring.datasource.url=jdbc:mysql://${db.service.ipAddress}:3308/learn?useUnicode=true&characterEncoding=utf8&useSSL=false&autoReconnect=true&serverTimezone=Asia/Shanghai\nspring.datasource.username=learn_shop\nspring.datasource.password=pass123\n# Hikari will use the above plus the following to setup connection pooling\nspring.datasource.type=com.zaxxer.hikari.HikariDataSource\n# 最小空闲数\nspring.datasource.hikari.minimum-idle=5\n# 链接池最大数量\nspring.datasource.hikari.maximum-pool-size=15\nspring.datasource.hikari.auto-commit=true\nspring.datasource.hikari.idle-timeout=30000\nspring.datasource.hikari.pool-name=DatebookHikariCP\n# 配置为0则是永久不过期\nspring.datasource.hikari.max-lifetime=0\nspring.datasource.hikari.connection-timeout=30000\nspring.datasource.hikari.connection-test-query=SELECT 1\n', '415333d67893c1cb41476ed0bf07e064', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 361, 'sys-config-mq.properties', 'DEFAULT_GROUP', '', 'mq.service.ipAddress=119.23.27.78\n####################################################################################################\n################################################## mq配置 ###########################################\n####################################################################################################\n#mq的类型\nconfig.mq.type=rabbit\n#mq服务器地址\nconfig.mq.host=${mq.service.ipAddress}\n#mq用户名和密码\nconfig.mq.username=admin\nconfig.mq.password=admin123\n#mq服务器端口\nconfig.mq.port=5672\n#虚拟主机\nconfig.mq.virtual-host=/learn-default\n\n# 日志收集\nconfig.mq.exchange.logCollect=logCollectExchange\nconfig.mq.queue.logCollect=logCollectQueue\nconfig.mq.routeKey.logCollect=logCollectRouteKey\n\n# zuul 向 system 系统发出执行 sql 请求\nconfig.mq.exchange.executeSql=executeSqlExchange\nconfig.mq.queue.executeSql=executeSqlQueue\nconfig.mq.routeKey.executeSql=executeSqlRouteKey\n\n# job 发送自动任务执行请求\nconfig.mq.exchange.runJob=runJobExchange\n#测试用\nconfig.mq.queue.runJobTest=runJobTestQueue\nconfig.mq.routeKey.runJobTest=runJobTestRouteKey\n\n# 商品系统\nconfig.mq.exchange.product=productExchange\n# product 发送刷新es缓存请求\nconfig.mq.queue.refreshEs=refreshEsQueue\nconfig.mq.routeKey.refreshEs=refreshEsRouteKey\n\n\n# job 向 system 系统发出发送邮件请求\nconfig.mq.exchange.sendMail=sendMailExchange\n\nconfig.mq.queue.sendMail=sendmailQueue\nconfig.mq.routeKey.sendMail=sendmailRouteKey\n\nconfig.mq.queue.sendMailDlx=sendmailQueueDlx\nconfig.mq.routeKey.sendMailDlx=sendmailRouteKeyDlx\n\nconfig.mq.queue.sendMailTrt=sendmailQueueTrt\nconfig.mq.routeKey.sendMailTrt=sendmailRouteKeyTrt\n\n#测试用\nconfig.mq.ts.test=ts-test', 'bf20892436bd464ffaf1bafcf7385921', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 362, 'sys-config-redis.properties', 'DEFAULT_GROUP', '', 'redis.service.ipAddress=119.23.27.78\n####################################################################################################\n################################################## redis配置 ###########################################\n####################################################################################################\n#redis 配置文件，根据情况选择集群或者单机模式\n##redis 集群环境配置\n##redis cluster\n#spring.redis.cluster.nodes=127.0.0.1:7001,127.0.0.1:7002,127.0.0.1:7003\n#spring.redis.cluster.commandTimeout=5000\n##redis 单点环境配置\n#redis\n#redis主机地址\nspring.redis.host=${redis.service.ipAddress}\n#redis主机端口\nspring.redis.port=6399\n#redis链接密码\nspring.redis.password=require@@pass##$$1234%%4321\nspring.redis.timeout=10000ms\n\n#Lettuce 是一个可伸缩线程安全的 Redis 客户端，多个线程可以共享同一个 RedisConnection，它利用优秀 netty NIO 框架来高效地管理多个连接\n# 连接池最大连接数（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-active=30\n# 连接池最大阻塞等待时间（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-wait=-1\n# 连接池中的最大空闲连接\nspring.redis.lettuce.pool.max-idle=8\n# 连接池中的最小空闲连接\nspring.redis.lettuce.pool.min-idle=0\n# 关闭超时时间\nspring.redis.lettuce.shutdown-timeout=100\n#mybatis缓存的数据库，默认为第15个\n#spring.redis.cacheDatabase=15\n#mybatis缓存过期时间（单位：分钟），默认：30\n#spring.redis.cacheExpire=30\n\n# redisson链接配置\n#当前处理核数量 * 2\nspring.redisson.thread=4\n#最小空闲连接数,默认值:10,最小保持连接数（长连接）\nspring.redisson.connectionMinimumIdleSize=12\n#连接空闲超时，单位：毫秒 默认10000;当前连接池里的连接数量超过了最小空闲连接数，\n#而连接空闲时间超过了该数值，这些连接将会自动被关闭，并从连接池里去掉\nspring.redisson.idleConnectionTimeout=10000\n#连接等待超时,单位：毫秒,默认10000\nspring.redisson.connectTimeout=10000\n#命令等待超时,单位：毫秒,默认3000；等待节点回复命令的时间。该时间从命令发送成功时开始计时\nspring.redisson.timeout=3000\n#命令失败重试次数，默认值:3\nspring.redisson.retryAttempts=2\n#命令重试发送时间间隔，单位：毫秒,默认值:1500\nspring.redisson.retryInterval=1500\n#单个连接最大订阅数量，默认值：5\nspring.redisson.subscriptionsPerConnection=5\n#客户端名称\n#spring.redisson.clientName=\n#发布和订阅连接的最小空闲连接数，默认值：1；Redisson内部经常通过发布和订阅来实现许多功能。\n#长期保持一定数量的发布订阅连接是必须的\nspring.redisson.subscriptionConnectionMinimumIdleSize=1\n#发布和订阅连接池大小，默认值：50\nspring.redisson.subscriptionConnectionPoolSize=50\n#连接池最大容量。默认值：64；连接池的连接数量自动弹性伸缩\nspring.redisson.connectionPoolSize=64\n#数据库编号，默认值：0\nspring.redisson.database=14\n#DNS监测时间间隔，单位：毫秒，默认值：5000\nspring.redisson.dnsMonitoringInterval=5000 ', '426859f6bb0e980186719071b9064b01', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 363, 'learn-shop-admin-system.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', 'cd2514d43aacb624f10c91874ce6dc99', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 364, 'learn-shop-admin-user.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n#测试\nwords: ${server.port}', 'df164483cf2f5cd13757be056ae0d845', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 365, 'learn-shop-core-order.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n    loadbalancer:\n      retry:\n        enabled: true #开启重试机制\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n\nribbon:\n  ConnectTimeout: 1000 #ribbon请求连接的超时时间\n  ReadTimeout: 3000 #请求处理的超时时间\n  OkToRetryOnAllOperations: true #对所有请求操作都进行重试\n  MaxAutoRetries: 0 #对当前服务的重试次数（第一次分配给9082的时候，如果404，则再重试MaxAutoRetries次，如果还是404，则切换到其他服务MaxAutoRetriesNextServer决定）\n  MaxAutoRetriesNextServer: 5 #切换服务的次数(比如本次请求分配给9082处理，发现404，则切换分配给9081处理，如果还是404，则返回404给客户端）', 'a985406e271833be7f380a2460d2e35f', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 366, 'learn-shop-core-product.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', '4052b4e480d59fe817b3290eca5a89aa', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 367, 'learn-shop-public-auth.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n#测试\nwords: 11111', '761ff8f4e3addcd1eefb5cb929d4aa33', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 368, 'learn-shop-public-job.yml', 'DEFAULT_GROUP', '', 'server:\r\n  port: 8011\r\n\r\nspring:\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        namespace: ${config.register.namespace} # 命名空间\r\n        server-addr: ${config.register.serverAddr} # 配置注册中心\r\n  rabbitmq:\r\n    host: ${config.mq.host} #rabbitMQ服务器地址\r\n    port: ${config.mq.port}  #rabbitMQ服务器端口\r\n    username: ${config.mq.username}\r\n    password: ${config.mq.password}\r\n    virtual-host: ${config.mq.virtual-host}\r\n\r\nfeign: #远程连接\r\n  hystrix: #熔断器配置\r\n    enabled: true #启动熔断器', 'dd9e9bc9a249b0eb3af17755ca047a33', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 369, 'learn-shop-core-search.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', '77fad7d59cf3523a4e27f2e84c540099', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 370, 'learn-shop-core-seckill.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n\nseckill:\n  gen-salt: wq<<.((0kkoe$$% # 设置盐值字符串，随便定义，用于混淆MD5值\n  load-data-start-before: 10 # 自动任务加载秒杀开始前多少分钟的数据加到缓存中（单位：分钟）\n  clear-data-end-arfer: 30 # 设置 redis 中秒杀活动结束后多少分钟数据过期（单位：分钟）\n  order-exp: 30 # 订单过期时间（单位：分钟）', 'bc6d0c12d9cfcbaf92da1b027f470bc3', '2021-03-12 16:02:42', '2021-03-12 08:02:42', NULL, '116.25.45.119', 'I', 'pro');
INSERT INTO `his_config_info` VALUES (0, 371, 'cloud-config.properties', 'DEFAULT_GROUP', '', '####################################################################################################\n################################################## 服务器地址 ########################################\n####################################################################################################\nservice.client.ipAddress=127.0.0.1\n####################################################################################################\n################################################## 注册中心 - nacose ###############################\n####################################################################################################\n# 命名空间\nconfig.register.namespace=${spring.cloud.nacos.config.namespace}\n# 注册中心地址\nconfig.register.serverAddr=http://${spring.cloud.nacos.config.server-addr}\n####################################################################################################\n################################################## learn-cloud-gateway ################################\n####################################################################################################\n# 移动 /usr/app/app\n# pc /usr/app/web\nconfig.gateway.static.locations=file:///D:/GitHub/learn/learn-shop-ui-admin/dist\n#config.gateway.static.locations=file:///D:/usr/app\n', '258faee275633d3b9698845b6ae65dd0', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 372, 'sys-config-db.properties', 'DEFAULT_GROUP', '', 'db.service.ipAddress=localhost\n####################################################################################################\n############################################### hikari 数据源配置 #####################################\n####################################################################################################\n# jdbc_config  datasource\nspring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver\nspring.datasource.url=jdbc:mysql://${db.service.ipAddress}:3308/learn?useUnicode=true&characterEncoding=utf8&useSSL=false&autoReconnect=true&serverTimezone=Asia/Shanghai\nspring.datasource.username=learn_shop\nspring.datasource.password=pass123\n# Hikari will use the above plus the following to setup connection pooling\nspring.datasource.type=com.zaxxer.hikari.HikariDataSource\n# 最小空闲数\nspring.datasource.hikari.minimum-idle=5\n# 链接池最大数量\nspring.datasource.hikari.maximum-pool-size=15\nspring.datasource.hikari.auto-commit=true\nspring.datasource.hikari.idle-timeout=30000\nspring.datasource.hikari.pool-name=DatebookHikariCP\n# 配置为0则是永久不过期\nspring.datasource.hikari.max-lifetime=0\nspring.datasource.hikari.connection-timeout=30000\nspring.datasource.hikari.connection-test-query=SELECT 1\n', 'bf5922103f147b35c77cf6b6f522d1b5', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 373, 'sys-config-mq.properties', 'DEFAULT_GROUP', '', 'mq.service.ipAddress=127.0.0.1\n####################################################################################################\n################################################## mq配置 ###########################################\n####################################################################################################\n#mq的类型\nconfig.mq.type=rabbit\n#mq服务器地址\nconfig.mq.host=${mq.service.ipAddress}\n#mq用户名和密码\nconfig.mq.username=admin\nconfig.mq.password=admin123\n#mq服务器端口\nconfig.mq.port=5672\n#虚拟主机\nconfig.mq.virtual-host=/learn-default\n\n# 日志收集\nconfig.mq.exchange.logCollect=logCollectExchange\nconfig.mq.queue.logCollect=logCollectQueue\nconfig.mq.routeKey.logCollect=logCollectRouteKey\n\n# zuul 向 system 系统发出执行 sql 请求\nconfig.mq.exchange.executeSql=executeSqlExchange\nconfig.mq.queue.executeSql=executeSqlQueue\nconfig.mq.routeKey.executeSql=executeSqlRouteKey\n\n# job 发送自动任务执行请求\nconfig.mq.exchange.runJob=runJobExchange\n#测试用\nconfig.mq.queue.runJobTest=runJobTestQueue\nconfig.mq.routeKey.runJobTest=runJobTestRouteKey\n\n# 商品系统\nconfig.mq.exchange.product=productExchange\n# product 发送刷新es缓存请求\nconfig.mq.queue.refreshEs=refreshEsQueue\nconfig.mq.routeKey.refreshEs=refreshEsRouteKey\n\n# job 向 system 系统发出发送邮件请求\nconfig.mq.exchange.sendMail=sendMailExchange\n\nconfig.mq.queue.sendMail=sendmailQueue\nconfig.mq.routeKey.sendMail=sendmailRouteKey\n\nconfig.mq.queue.sendMailDlx=sendmailQueueDlx\nconfig.mq.routeKey.sendMailDlx=sendmailRouteKeyDlx\n\nconfig.mq.queue.sendMailTrt=sendmailQueueTrt\nconfig.mq.routeKey.sendMailTrt=sendmailRouteKeyTrt\n\n#测试用\nconfig.mq.ts.test=ts-test', '031cde371837cac3ee643e62e9216231', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 374, 'sys-config-redis.properties', 'DEFAULT_GROUP', '', 'redis.service.ipAddress=127.0.0.1\n####################################################################################################\n################################################## redis配置 ###########################################\n####################################################################################################\n#redis 配置文件，根据情况选择集群或者单机模式\n##redis 集群环境配置\n##redis cluster\n#spring.redis.cluster.nodes=127.0.0.1:7001,127.0.0.1:7002,127.0.0.1:7003\n#spring.redis.cluster.commandTimeout=5000\n##redis 单点环境配置\n#redis\n#redis主机地址\nspring.redis.host=${redis.service.ipAddress}\n#redis主机端口\nspring.redis.port=6379\n#redis链接密码\nspring.redis.password=\nspring.redis.timeout=10000ms\n\n#Lettuce 是一个可伸缩线程安全的 Redis 客户端，多个线程可以共享同一个 RedisConnection，它利用优秀 netty NIO 框架来高效地管理多个连接\n# 连接池最大连接数（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-active=30\n# 连接池最大阻塞等待时间（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-wait=-1\n# 连接池中的最大空闲连接\nspring.redis.lettuce.pool.max-idle=8\n# 连接池中的最小空闲连接\nspring.redis.lettuce.pool.min-idle=0\n# 关闭超时时间\nspring.redis.lettuce.shutdown-timeout=100\n#mybatis缓存的数据库，默认：第15个\n#spring.redis.cacheDatabase=15\n#mybatis缓存过期时间（单位：分钟），默认：30\n#spring.redis.cacheExpire=30\n\n# redisson链接配置\n#当前处理核数量 * 2\nspring.redisson.thread=4\n#最小空闲连接数,默认值:10,最小保持连接数（长连接）\nspring.redisson.connectionMinimumIdleSize=12\n#连接空闲超时，单位：毫秒 默认10000;当前连接池里的连接数量超过了最小空闲连接数，\n#而连接空闲时间超过了该数值，这些连接将会自动被关闭，并从连接池里去掉\nspring.redisson.idleConnectionTimeout=10000\n#连接等待超时,单位：毫秒,默认10000\nspring.redisson.connectTimeout=10000\n#命令等待超时,单位：毫秒,默认3000；等待节点回复命令的时间。该时间从命令发送成功时开始计时\nspring.redisson.timeout=3000\n#命令失败重试次数，默认值:3\nspring.redisson.retryAttempts=2\n#命令重试发送时间间隔，单位：毫秒,默认值:1500\nspring.redisson.retryInterval=1500\n#单个连接最大订阅数量，默认值：5\nspring.redisson.subscriptionsPerConnection=5\n#客户端名称\n#spring.redisson.clientName=\n#发布和订阅连接的最小空闲连接数，默认值：1；Redisson内部经常通过发布和订阅来实现许多功能。\n#长期保持一定数量的发布订阅连接是必须的\nspring.redisson.subscriptionConnectionMinimumIdleSize=1\n#发布和订阅连接池大小，默认值：50\nspring.redisson.subscriptionConnectionPoolSize=50\n#连接池最大容量。默认值：64；连接池的连接数量自动弹性伸缩\nspring.redisson.connectionPoolSize=64\n#数据库编号，默认值：0\nspring.redisson.database=14\n#DNS监测时间间隔，单位：毫秒，默认值：5000\nspring.redisson.dnsMonitoringInterval=5000 ', '6b275219932c5d6f38038a546e0c1568', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 375, 'learn-shop-admin-user.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n#测试\nwords: ${server.port}', 'df164483cf2f5cd13757be056ae0d845', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 376, 'learn-shop-admin-system.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n#测试\nwords: 11111', '761ff8f4e3addcd1eefb5cb929d4aa33', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 377, 'learn-shop-core-order.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n    loadbalancer:\n      retry:\n        enabled: true #开启重试机制\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n\nribbon:\n  ConnectTimeout: 1000 #ribbon请求连接的超时时间\n  ReadTimeout: 3000 #请求处理的超时时间\n  OkToRetryOnAllOperations: true #对所有请求操作都进行重试\n  MaxAutoRetries: 0 #对当前服务的重试次数（第一次分配给9082的时候，如果404，则再重试MaxAutoRetries次，如果还是404，则切换到其他服务MaxAutoRetriesNextServer决定）\n  MaxAutoRetriesNextServer: 5 #切换服务的次数(比如本次请求分配给9082处理，发现404，则切换分配给9081处理，如果还是404，则返回404给客户端）', 'a985406e271833be7f380a2460d2e35f', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 378, 'learn-shop-core-product.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', '4052b4e480d59fe817b3290eca5a89aa', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 379, 'learn-shop-public-auth.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n#测试\nwords: 11111', '761ff8f4e3addcd1eefb5cb929d4aa33', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 380, 'learn-shop-public-job.yml', 'DEFAULT_GROUP', '', 'server:\r\n  port: 8011\r\n\r\nspring:\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        namespace: ${config.register.namespace} # 命名空间\r\n        server-addr: ${config.register.serverAddr} # 配置注册中心\r\n  rabbitmq:\r\n    host: ${config.mq.host} #rabbitMQ服务器地址\r\n    port: ${config.mq.port}  #rabbitMQ服务器端口\r\n    username: ${config.mq.username}\r\n    password: ${config.mq.password}\r\n    virtual-host: ${config.mq.virtual-host}\r\n\r\nfeign: #远程连接\r\n  hystrix: #熔断器配置\r\n    enabled: true #启动熔断器', 'dd9e9bc9a249b0eb3af17755ca047a33', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 381, 'learn-shop-core-search.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器        ', 'a7b6b5e77075300b4ea253d2d53a04e4', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (0, 382, 'learn-shop-core-seckill.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n\nseckill:\n  gen-salt: wq<<.((0kkoe$$% # 设置盐值字符串，随便定义，用于混淆MD5值\n  load-data-start-before: 10 # 自动任务加载秒杀开始前多少分钟的数据加到缓存中（单位：分钟）\n  clear-data-end-arfer: 30 # 设置 redis 中秒杀活动结束后多少分钟数据过期（单位：分钟）\n  order-exp: 30 # 订单过期时间（单位：分钟）', 'bc6d0c12d9cfcbaf92da1b027f470bc3', '2021-03-12 16:02:56', '2021-03-12 08:02:57', NULL, '116.25.45.119', 'I', 'dev');
INSERT INTO `his_config_info` VALUES (27, 383, 'cloud-config.properties', 'DEFAULT_GROUP', '', '####################################################################################################\n################################################## 服务器地址 ########################################\n####################################################################################################\nservice.client.ipAddress=127.0.0.1\n####################################################################################################\n################################################## 注册中心 - nacose ###############################\n####################################################################################################\n# 命名空间\nconfig.register.namespace=${spring.cloud.nacos.config.namespace}\n# 注册中心地址\nconfig.register.serverAddr=http://${spring.cloud.nacos.config.server-addr}\n####################################################################################################\n################################################## learn-cloud-gateway ################################\n####################################################################################################\n# 移动 /usr/app/app\n# pc /usr/app/web\nconfig.gateway.static.locations=file:///D:/GitHub/learn/learn-shop-ui-admin/dist\n#config.gateway.static.locations=file:///D:/usr/app\n', '258faee275633d3b9698845b6ae65dd0', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (28, 384, 'sys-config-db.properties', 'DEFAULT_GROUP', '', 'db.service.ipAddress=localhost\n####################################################################################################\n############################################### hikari 数据源配置 #####################################\n####################################################################################################\n# jdbc_config  datasource\nspring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver\nspring.datasource.url=jdbc:mysql://${db.service.ipAddress}:3308/learn?useUnicode=true&characterEncoding=utf8&useSSL=false&autoReconnect=true&serverTimezone=Asia/Shanghai\nspring.datasource.username=learn_shop\nspring.datasource.password=pass123\n# Hikari will use the above plus the following to setup connection pooling\nspring.datasource.type=com.zaxxer.hikari.HikariDataSource\n# 最小空闲数\nspring.datasource.hikari.minimum-idle=5\n# 链接池最大数量\nspring.datasource.hikari.maximum-pool-size=15\nspring.datasource.hikari.auto-commit=true\nspring.datasource.hikari.idle-timeout=30000\nspring.datasource.hikari.pool-name=DatebookHikariCP\n# 配置为0则是永久不过期\nspring.datasource.hikari.max-lifetime=0\nspring.datasource.hikari.connection-timeout=30000\nspring.datasource.hikari.connection-test-query=SELECT 1\n', 'bf5922103f147b35c77cf6b6f522d1b5', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (29, 385, 'sys-config-mq.properties', 'DEFAULT_GROUP', '', 'mq.service.ipAddress=127.0.0.1\n####################################################################################################\n################################################## mq配置 ###########################################\n####################################################################################################\n#mq的类型\nconfig.mq.type=rabbit\n#mq服务器地址\nconfig.mq.host=${mq.service.ipAddress}\n#mq用户名和密码\nconfig.mq.username=admin\nconfig.mq.password=admin123\n#mq服务器端口\nconfig.mq.port=5672\n#虚拟主机\nconfig.mq.virtual-host=/learn-default\n\n# 日志收集\nconfig.mq.exchange.logCollect=logCollectExchange\nconfig.mq.queue.logCollect=logCollectQueue\nconfig.mq.routeKey.logCollect=logCollectRouteKey\n\n# zuul 向 system 系统发出执行 sql 请求\nconfig.mq.exchange.executeSql=executeSqlExchange\nconfig.mq.queue.executeSql=executeSqlQueue\nconfig.mq.routeKey.executeSql=executeSqlRouteKey\n\n# job 发送自动任务执行请求\nconfig.mq.exchange.runJob=runJobExchange\n#测试用\nconfig.mq.queue.runJobTest=runJobTestQueue\nconfig.mq.routeKey.runJobTest=runJobTestRouteKey\n\n# 商品系统\nconfig.mq.exchange.product=productExchange\n# product 发送刷新es缓存请求\nconfig.mq.queue.refreshEs=refreshEsQueue\nconfig.mq.routeKey.refreshEs=refreshEsRouteKey\n\n# job 向 system 系统发出发送邮件请求\nconfig.mq.exchange.sendMail=sendMailExchange\n\nconfig.mq.queue.sendMail=sendmailQueue\nconfig.mq.routeKey.sendMail=sendmailRouteKey\n\nconfig.mq.queue.sendMailDlx=sendmailQueueDlx\nconfig.mq.routeKey.sendMailDlx=sendmailRouteKeyDlx\n\nconfig.mq.queue.sendMailTrt=sendmailQueueTrt\nconfig.mq.routeKey.sendMailTrt=sendmailRouteKeyTrt\n\n#测试用\nconfig.mq.ts.test=ts-test', '031cde371837cac3ee643e62e9216231', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (30, 386, 'sys-config-redis.properties', 'DEFAULT_GROUP', '', 'redis.service.ipAddress=127.0.0.1\n####################################################################################################\n################################################## redis配置 ###########################################\n####################################################################################################\n#redis 配置文件，根据情况选择集群或者单机模式\n##redis 集群环境配置\n##redis cluster\n#spring.redis.cluster.nodes=127.0.0.1:7001,127.0.0.1:7002,127.0.0.1:7003\n#spring.redis.cluster.commandTimeout=5000\n##redis 单点环境配置\n#redis\n#redis主机地址\nspring.redis.host=${redis.service.ipAddress}\n#redis主机端口\nspring.redis.port=6379\n#redis链接密码\nspring.redis.password=\nspring.redis.timeout=10000ms\n\n#Lettuce 是一个可伸缩线程安全的 Redis 客户端，多个线程可以共享同一个 RedisConnection，它利用优秀 netty NIO 框架来高效地管理多个连接\n# 连接池最大连接数（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-active=30\n# 连接池最大阻塞等待时间（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-wait=-1\n# 连接池中的最大空闲连接\nspring.redis.lettuce.pool.max-idle=8\n# 连接池中的最小空闲连接\nspring.redis.lettuce.pool.min-idle=0\n# 关闭超时时间\nspring.redis.lettuce.shutdown-timeout=100\n#mybatis缓存的数据库，默认：第15个\n#spring.redis.cacheDatabase=15\n#mybatis缓存过期时间（单位：分钟），默认：30\n#spring.redis.cacheExpire=30\n\n# redisson链接配置\n#当前处理核数量 * 2\nspring.redisson.thread=4\n#最小空闲连接数,默认值:10,最小保持连接数（长连接）\nspring.redisson.connectionMinimumIdleSize=12\n#连接空闲超时，单位：毫秒 默认10000;当前连接池里的连接数量超过了最小空闲连接数，\n#而连接空闲时间超过了该数值，这些连接将会自动被关闭，并从连接池里去掉\nspring.redisson.idleConnectionTimeout=10000\n#连接等待超时,单位：毫秒,默认10000\nspring.redisson.connectTimeout=10000\n#命令等待超时,单位：毫秒,默认3000；等待节点回复命令的时间。该时间从命令发送成功时开始计时\nspring.redisson.timeout=3000\n#命令失败重试次数，默认值:3\nspring.redisson.retryAttempts=2\n#命令重试发送时间间隔，单位：毫秒,默认值:1500\nspring.redisson.retryInterval=1500\n#单个连接最大订阅数量，默认值：5\nspring.redisson.subscriptionsPerConnection=5\n#客户端名称\n#spring.redisson.clientName=\n#发布和订阅连接的最小空闲连接数，默认值：1；Redisson内部经常通过发布和订阅来实现许多功能。\n#长期保持一定数量的发布订阅连接是必须的\nspring.redisson.subscriptionConnectionMinimumIdleSize=1\n#发布和订阅连接池大小，默认值：50\nspring.redisson.subscriptionConnectionPoolSize=50\n#连接池最大容量。默认值：64；连接池的连接数量自动弹性伸缩\nspring.redisson.connectionPoolSize=64\n#数据库编号，默认值：0\nspring.redisson.database=14\n#DNS监测时间间隔，单位：毫秒，默认值：5000\nspring.redisson.dnsMonitoringInterval=5000 ', '6b275219932c5d6f38038a546e0c1568', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (31, 387, 'learn-shop-admin-user.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n#测试\nwords: ${server.port}', 'df164483cf2f5cd13757be056ae0d845', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (32, 388, 'learn-shop-admin-system.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n#测试\nwords: 11111', '761ff8f4e3addcd1eefb5cb929d4aa33', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (33, 389, 'learn-shop-core-order.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n    loadbalancer:\n      retry:\n        enabled: true #开启重试机制\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n\nribbon:\n  ConnectTimeout: 1000 #ribbon请求连接的超时时间\n  ReadTimeout: 3000 #请求处理的超时时间\n  OkToRetryOnAllOperations: true #对所有请求操作都进行重试\n  MaxAutoRetries: 0 #对当前服务的重试次数（第一次分配给9082的时候，如果404，则再重试MaxAutoRetries次，如果还是404，则切换到其他服务MaxAutoRetriesNextServer决定）\n  MaxAutoRetriesNextServer: 5 #切换服务的次数(比如本次请求分配给9082处理，发现404，则切换分配给9081处理，如果还是404，则返回404给客户端）', 'a985406e271833be7f380a2460d2e35f', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (34, 390, 'learn-shop-core-product.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', '4052b4e480d59fe817b3290eca5a89aa', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (35, 391, 'learn-shop-public-auth.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n#测试\nwords: 11111', '761ff8f4e3addcd1eefb5cb929d4aa33', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (36, 392, 'learn-shop-public-job.yml', 'DEFAULT_GROUP', '', 'server:\r\n  port: 8011\r\n\r\nspring:\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        namespace: ${config.register.namespace} # 命名空间\r\n        server-addr: ${config.register.serverAddr} # 配置注册中心\r\n  rabbitmq:\r\n    host: ${config.mq.host} #rabbitMQ服务器地址\r\n    port: ${config.mq.port}  #rabbitMQ服务器端口\r\n    username: ${config.mq.username}\r\n    password: ${config.mq.password}\r\n    virtual-host: ${config.mq.virtual-host}\r\n\r\nfeign: #远程连接\r\n  hystrix: #熔断器配置\r\n    enabled: true #启动熔断器', 'dd9e9bc9a249b0eb3af17755ca047a33', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (52, 393, 'learn-shop-core-search.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器        ', 'a7b6b5e77075300b4ea253d2d53a04e4', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (58, 394, 'learn-shop-core-seckill.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\n\n\nseckill:\n  gen-salt: wq<<.((0kkoe$$% # 设置盐值字符串，随便定义，用于混淆MD5值\n  load-data-start-before: 10 # 自动任务加载秒杀开始前多少分钟的数据加到缓存中（单位：分钟）\n  clear-data-end-arfer: 30 # 设置 redis 中秒杀活动结束后多少分钟数据过期（单位：分钟）\n  order-exp: 30 # 订单过期时间（单位：分钟）', 'bc6d0c12d9cfcbaf92da1b027f470bc3', '2021-03-12 16:03:02', '2021-03-12 08:03:02', NULL, '116.25.45.119', 'D', 'ece7e9eb-7b24-44f0-bbe1-65ff1b80ecb5');
INSERT INTO `his_config_info` VALUES (17, 395, 'cloud-config.properties', 'DEFAULT_GROUP', '', '####################################################################################################\n################################################## 服务器地址 ########################################\n####################################################################################################\nservice.client.ipAddress=119.23.27.78\n####################################################################################################\n################################################## 注册中心 - nacose ###############################\n####################################################################################################\n# 命名空间\nconfig.register.namespace=${spring.cloud.nacos.config.namespace}\n# 注册中心地址\nconfig.register.serverAddr=http://${spring.cloud.nacos.config.server-addr}\n####################################################################################################\n################################################## learn-cloud-gateway ################################\n####################################################################################################\n# 移动 /usr/app/app\n# pc /usr/app/web\nconfig.gateway.static.locations=file:/usr/local/app\n#config.zuul.static.locations=file:///D:/usr/app', '76b34d8efe0e9734030d00e35643bc60', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (18, 396, 'sys-config-db.properties', 'DEFAULT_GROUP', '', 'db.service.ipAddress=119.23.27.78\n####################################################################################################\n############################################### hikari 数据源配置 ################\n####################################################################################################\n# jdbc_config  datasource\nspring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver\nspring.datasource.url=jdbc:mysql://${db.service.ipAddress}:3308/learn?useUnicode=true&characterEncoding=utf8&useSSL=false&autoReconnect=true&serverTimezone=Asia/Shanghai\nspring.datasource.username=learn_shop\nspring.datasource.password=pass123\n# Hikari will use the above plus the following to setup connection pooling\nspring.datasource.type=com.zaxxer.hikari.HikariDataSource\n# 最小空闲数\nspring.datasource.hikari.minimum-idle=5\n# 链接池最大数量\nspring.datasource.hikari.maximum-pool-size=15\nspring.datasource.hikari.auto-commit=true\nspring.datasource.hikari.idle-timeout=30000\nspring.datasource.hikari.pool-name=DatebookHikariCP\n# 配置为0则是永久不过期\nspring.datasource.hikari.max-lifetime=0\nspring.datasource.hikari.connection-timeout=30000\nspring.datasource.hikari.connection-test-query=SELECT 1\n', '415333d67893c1cb41476ed0bf07e064', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (19, 397, 'sys-config-mq.properties', 'DEFAULT_GROUP', '', 'mq.service.ipAddress=119.23.27.78\n####################################################################################################\n################################################## mq配置 ###########################################\n####################################################################################################\n#mq的类型\nconfig.mq.type=rabbit\n#mq服务器地址\nconfig.mq.host=${mq.service.ipAddress}\n#mq用户名和密码\nconfig.mq.username=admin\nconfig.mq.password=admin123\n#mq服务器端口\nconfig.mq.port=5672\n#虚拟主机\nconfig.mq.virtual-host=/learn-default\n\n# 日志收集\nconfig.mq.exchange.logCollect=logCollectExchange\nconfig.mq.queue.logCollect=logCollectQueue\nconfig.mq.routeKey.logCollect=logCollectRouteKey\n\n# zuul 向 system 系统发出执行 sql 请求\nconfig.mq.exchange.executeSql=executeSqlExchange\nconfig.mq.queue.executeSql=executeSqlQueue\nconfig.mq.routeKey.executeSql=executeSqlRouteKey\n\n# job 发送自动任务执行请求\nconfig.mq.exchange.runJob=runJobExchange\n#测试用\nconfig.mq.queue.runJobTest=runJobTestQueue\nconfig.mq.routeKey.runJobTest=runJobTestRouteKey\n\n# 商品系统\nconfig.mq.exchange.product=productExchange\n# product 发送刷新es缓存请求\nconfig.mq.queue.refreshEs=refreshEsQueue\nconfig.mq.routeKey.refreshEs=refreshEsRouteKey\n\n\n# job 向 system 系统发出发送邮件请求\nconfig.mq.exchange.sendMail=sendMailExchange\n\nconfig.mq.queue.sendMail=sendmailQueue\nconfig.mq.routeKey.sendMail=sendmailRouteKey\n\nconfig.mq.queue.sendMailDlx=sendmailQueueDlx\nconfig.mq.routeKey.sendMailDlx=sendmailRouteKeyDlx\n\nconfig.mq.queue.sendMailTrt=sendmailQueueTrt\nconfig.mq.routeKey.sendMailTrt=sendmailRouteKeyTrt\n\n#测试用\nconfig.mq.ts.test=ts-test', 'bf20892436bd464ffaf1bafcf7385921', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (20, 398, 'sys-config-redis.properties', 'DEFAULT_GROUP', '', 'redis.service.ipAddress=119.23.27.78\n####################################################################################################\n################################################## redis配置 ###########################################\n####################################################################################################\n#redis 配置文件，根据情况选择集群或者单机模式\n##redis 集群环境配置\n##redis cluster\n#spring.redis.cluster.nodes=127.0.0.1:7001,127.0.0.1:7002,127.0.0.1:7003\n#spring.redis.cluster.commandTimeout=5000\n##redis 单点环境配置\n#redis\n#redis主机地址\nspring.redis.host=${redis.service.ipAddress}\n#redis主机端口\nspring.redis.port=6399\n#redis链接密码\nspring.redis.password=require@@pass##$$1234%%4321\nspring.redis.timeout=10000ms\n\n#Lettuce 是一个可伸缩线程安全的 Redis 客户端，多个线程可以共享同一个 RedisConnection，它利用优秀 netty NIO 框架来高效地管理多个连接\n# 连接池最大连接数（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-active=30\n# 连接池最大阻塞等待时间（使用负值表示没有限制）\nspring.redis.lettuce.pool.max-wait=-1\n# 连接池中的最大空闲连接\nspring.redis.lettuce.pool.max-idle=8\n# 连接池中的最小空闲连接\nspring.redis.lettuce.pool.min-idle=0\n# 关闭超时时间\nspring.redis.lettuce.shutdown-timeout=100\n#mybatis缓存的数据库，默认为第15个\n#spring.redis.cacheDatabase=15\n#mybatis缓存过期时间（单位：分钟），默认：30\n#spring.redis.cacheExpire=30\n\n# redisson链接配置\n#当前处理核数量 * 2\nspring.redisson.thread=4\n#最小空闲连接数,默认值:10,最小保持连接数（长连接）\nspring.redisson.connectionMinimumIdleSize=12\n#连接空闲超时，单位：毫秒 默认10000;当前连接池里的连接数量超过了最小空闲连接数，\n#而连接空闲时间超过了该数值，这些连接将会自动被关闭，并从连接池里去掉\nspring.redisson.idleConnectionTimeout=10000\n#连接等待超时,单位：毫秒,默认10000\nspring.redisson.connectTimeout=10000\n#命令等待超时,单位：毫秒,默认3000；等待节点回复命令的时间。该时间从命令发送成功时开始计时\nspring.redisson.timeout=3000\n#命令失败重试次数，默认值:3\nspring.redisson.retryAttempts=2\n#命令重试发送时间间隔，单位：毫秒,默认值:1500\nspring.redisson.retryInterval=1500\n#单个连接最大订阅数量，默认值：5\nspring.redisson.subscriptionsPerConnection=5\n#客户端名称\n#spring.redisson.clientName=\n#发布和订阅连接的最小空闲连接数，默认值：1；Redisson内部经常通过发布和订阅来实现许多功能。\n#长期保持一定数量的发布订阅连接是必须的\nspring.redisson.subscriptionConnectionMinimumIdleSize=1\n#发布和订阅连接池大小，默认值：50\nspring.redisson.subscriptionConnectionPoolSize=50\n#连接池最大容量。默认值：64；连接池的连接数量自动弹性伸缩\nspring.redisson.connectionPoolSize=64\n#数据库编号，默认值：0\nspring.redisson.database=14\n#DNS监测时间间隔，单位：毫秒，默认值：5000\nspring.redisson.dnsMonitoringInterval=5000 ', '426859f6bb0e980186719071b9064b01', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (21, 399, 'learn-shop-admin-system.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', 'cd2514d43aacb624f10c91874ce6dc99', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (22, 400, 'learn-shop-admin-user.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n#测试\nwords: ${server.port}', 'df164483cf2f5cd13757be056ae0d845', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (23, 401, 'learn-shop-core-order.yml', 'DEFAULT_GROUP', '', 'feign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器\nhystrix:\n  command:\n    default:\n      execution:\n        timeout:\n          enabled: true #Hystrix 是否启用超时时间\n        isolation:\n          thread:\n            timeoutInMilliseconds: 8000 #Hystrix断路器的超时时间，默认是1s，断路器的超时时间需要大于ribbon的超时时间，不然不会触发重试\n          strategy: SEMAPHORE\nspring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n    loadbalancer:\n      retry:\n        enabled: true #开启重试机制\n  rabbitmq:\n    host: ${config.mq.host} #rabbitMQ服务器地址\n    port: ${config.mq.port}  #rabbitMQ服务器端口\n    username: ${config.mq.username}\n    password: ${config.mq.password}\n    virtual-host: ${config.mq.virtual-host}\n\n\nribbon:\n  ConnectTimeout: 1000 #ribbon请求连接的超时时间\n  ReadTimeout: 3000 #请求处理的超时时间\n  OkToRetryOnAllOperations: true #对所有请求操作都进行重试\n  MaxAutoRetries: 0 #对当前服务的重试次数（第一次分配给9082的时候，如果404，则再重试MaxAutoRetries次，如果还是404，则切换到其他服务MaxAutoRetriesNextServer决定）\n  MaxAutoRetriesNextServer: 5 #切换服务的次数(比如本次请求分配给9082处理，发现404，则切换分配给9081处理，如果还是404，则返回404给客户端）', 'a985406e271833be7f380a2460d2e35f', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
INSERT INTO `his_config_info` VALUES (24, 402, 'learn-shop-core-product.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    nacos:\n      discovery:\n        namespace: ${config.register.namespace} # 命名空间\n        server-addr: ${config.register.serverAddr} # 配置注册中心\n\n\nfeign: #远程连接\n  hystrix: #熔断器配置\n    enabled: true #启动熔断器', '4052b4e480d59fe817b3290eca5a89aa', '2021-03-12 16:03:12', '2021-03-12 08:03:13', NULL, '116.25.45.119', 'D', 'abf7c5c7-f727-47cb-87c7-33e84cd05fc6');
